def get_data_as_dict(uuid,datamode="ref"):
	mylist = [
	datautils.get_entity_as_dict(entities.get(uuid),datamode),
	datautils.get_entity_geo_as_dict(entities_geo.get(uuid)),
	datautils.get_entity_geo_address_as_dict(entities_geo_address.get(uuid)),
	]
	r = {}
	for item in mylist:
		if item:
			r.update(item)			
	a = {
	"phone":None,
	"openingtimes": entities_openingtimes[uuid]
	}
	r.update(a)
	return {"restaurant": r}
	
def get_data_as_dicts(uuids,latlon):
	if not uuids:
		return None
	r =[]
	for uuid in uuids:
		mydict=get_data_as_dict(uuid)
		if latlon:
			distance=datautils.get_distance_as_dict(latlon,(entities_geo[uuid][0],entities_geo[uuid][1]))
			mydict["distance"]=distance
		r.append(mydict)
	return r	